function thinStroke(child: React.ReactElement): React.ReactElement {
	if (!child.props) return child;

	// eslint-disable-next-line @typescript-eslint/no-explicit-any
	const props = child.props as { [key: string]: any };

	const newProps: typeof props = {};

	if (props.strokeWidth) {
		newProps.strokeWidth = parseFloat(props.strokeWidth) / 5;
	}

	if (props.children) {
		newProps.children = React.Children.map(props.children, (c) => (React.isValidElement(c) ? thinStroke(c) : c));
	}

	return React.cloneElement(child, newProps);
}

